// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

import "./Market.sol";
//import "./NumLib.sol";

contract BidMarket {//is Market {
    //using NumLib for int;
    //using Utils for *;

    /*
    function exemple(int value) {
        return value.negative();
    }
    */

    enum State {
        Ongoing,
        Failed,
        Succeeded,
        PaidOut
    }

    mapping(address => uint) public amounts;

    address payable owner; // = msg.sender;
    uint public totalCollected;

    address moderator;
    string public Name;
    uint public TargetAmount;
    uint public FundingDeadline;
    address payable public Beneficiary;
    State public state;
    bool collected;

    modifier ownerOnly {
        require(msg.sender == owner);
        _;
    }

    modifier onlyBy(address addr) {
        require(msg.sender == addr);
        _;
    }

    modifier gameStarted() {
        require(state == State.Ongoing);
        _;
    }

    modifier inState(State expectedState) {
        require(state == expectedState, "Invalid State");
        _;
    }

    constructor(string memory ContractName, uint targetAmount, uint duration, address payable beneficiary) {
        Name = ContractName;
        TargetAmount = targetAmount;
        FundingDeadline = currentTime() + duration * 1 days;
        Beneficiary = beneficiary;
        state = State.Ongoing;
    }

    function currentTime() internal view returns(uint) {
        return block.timestamp;
    }

    function bid() public payable inState(State.Ongoing) {
        amounts[msg.sender] += msg.value;
        totalCollected += msg.value;

        if (totalCollected >= TargetAmount) {
            collected = true; 
        }
    }

    function finishBid() public {
        //require(!beforeDeadLine(), "Cannot finish campaign before the end");

        if (!collected) {
            state = State.Failed;
        } else {
            state = State.Succeeded;
        }

        //emit CampaignFinished(this, totalCollected, collected);
    }

    function collect() public {
        if (Beneficiary.send(totalCollected)) {
            state = State.PaidOut;
        } else {
            state = State.Failed;
        }

    }

    function withdraw() public {
        require(amounts[msg.sender] > 0, "Nothing was contributed");
        //uint contributed = amounts[msg.sender];
        amounts[msg.sender] = 0;

        /*
        if (!msg.sender.send(contributed)) {
            amounts[msg.sender] = contributed;
        }
        */
    }

    function removeContract() public ownerOnly {}

    function updateContract() public ownerOnly gameStarted {}

    function remoteItem(uint itemId) public onlyBy(moderator) {}

    event CampaignFinished(address addr, uint totalCollected, bool succeeded);

//////////

/*
    event ItemForSale(
        uint Id,
        uint price
        //,
        //uint indexed type
    );

    function saleItem(uint Id, uint price) {
        emit ItemForSale(1, 4000);
    }
*/

    //contract.events.ItemForSale({ filter: { type: [0,1] }, fomrBlock: 0, toBlock: 'latest' }, function(err, event) { log(event); })

}
